from sympy import isprime
def dec_to_bin(x):
    return (bin(x)[2:])
fib = [1,1]
for i in range(300):
    fib.append(fib[-1] + fib[-2])
for a in fib[3:]:
    b = dec_to_bin(a)
    c = b[::-1]
    d = int(c,2)
    if isprime(d) and c[0] != '0':
        print(d,end=', ')
